import { ADD_WIN, SUBTRACT_WIN } from '../constants/playerConstants';

export const addWin = (name) => ({
  type: ADD_WIN,
  payload: name,
});

export const subtractWin = (name) => ({
  type: SUBTRACT_WIN,
  payload: name,
});
